Message:
introduce new jqGrid parameter iColByName

There are no need to use self written functions like
getColumnIndexByName. The new option iColByName is the map by column
name. If colModel will be reordered (inside of remapColumns for example)
then the map will be recreated.

Thus if one knows the column name `colName` then `iColByName[colName]`
which can be used as index to get `colModel` item:

var p = $(this).jqGrid("getGridParam"),
iCol = p.iColByName[colName], cm;

if (iCol !== undefined) {
cm = p.colModel[iCol];
}
